import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "../style.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Form from "./Form.js";



function About() {
  return (
    <Container fluid className="about-section" > 
      <Container>

            <Row>
                <Col>
                    <Form/>
                </Col>


              </Row>
              </Container>

    </Container>
  );
}

export default About;
